import React from 'react';
import { Button, FormGroup, FormControl, ControlLabel } from "react-bootstrap";
import "./style2.css"
import GoogleLoginButton from "./GoogleLoginButton";


// presentational component, only a stateless function
// gets props by destructuring the props object
// note that the input fields use the props to render their value attribute
const LoginForm = ({
    username, password, 
    handleChangeUsername,  
    handleChangePassword, 
    handleSubmit,
    handleGoogleSignIn,
    validate,
    isAuthenticated
  }) => {
    return (

      <div className="wrapper fadeInDown">
        <form onSubmit={handleSubmit} method= "Post">
        <input type="text" id="username" class="fadeIn" name="id" placeholder="ID" autoFocus value = {username} onChange={handleChangeUsername}/>
        <input type="password" id="password" class="fadeIn" name="password" placeholder="Password" autoFocus value = {password} onChange={handleChangePassword}/>


          <input type="submit" id="submit" class="fadeIn" value="로그인" disabled={!validate(username, password)}/>

          <div className="Login-google">
            <GoogleLoginButton
              onSignIn={handleGoogleSignIn}
              isAuthenticated={isAuthenticated}
            />
          </div>


        </form>

      </div>
    );
  }

export default LoginForm;
